import React from 'react';

const Player = ({ name, score, currentScore, isActive, wins }) => {
    return (
        <div className={`player ${isActive ? 'active' : ''}`}>
            <h2>{{name}}</h2>
            <p>Global Score: {score}</p>
            <p>Current Score: {currentScore}</p>
            <p>Wins: {wins}</p>
        </div>
    );
};

export default Player;
